/* Determine system endianness */
#if defined(__BYTE_ORDER__) && (__BYTE_ORDER__ == __ORDER_BIG_ENDIAN__)
#define BIG_ENDIAN_SYSTEM 1
#else
#define BIG_ENDIAN_SYSTEM 0
#endif

/* Little‑endian lookup table */
static const uint16_t hex8_lookup_le[256]; 

/* Big‑endian lookup table */
static const uint16_t hex8_lookup_be[256];

/* Little‑endian lookup table */
static const uint32_t hex16_lookup_le[1 << 16];

/* Big‑endian lookup table */
static const uint32_t hex16_lookup_be[1 << 16];

#define HEX_DECODE_SENTINEL 0xFFFFu
static const uint16_t hexpair_decode_table[1 << 16];

/* Select the proper lookup table */
#define HEX8_LOOKUP (BIG_ENDIAN_SYSTEM ? hex8_lookup_be : hex8_lookup_le)
#define HEX16_LOOKUP (BIG_ENDIAN_SYSTEM ? hex16_lookup_be : hex16_lookup_le)

/**
 * @brief Encode data into Base16 (hexadecimal) format using lowercase letters.
 *
 * @param data     The input data to be encoded.
 * @param data_len The length of the input data.
 * @param out      The buffer to store the encoded Base16 string.
 * @param out_len  The size of the output buffer (must include space for NUL).
 * @return Number of characters in the output (excluding the NUL),
 *         or an error code.
 */
int multibase_base16_encode(const uint8_t *restrict data, size_t data_len, char *restrict out, size_t out_len)
{
    if (!data || !out)
    {
        return MULTIBASE_ERR_NULL_POINTER;
    }

    if (out_len < data_len * 2u + 1u)
    {
        return MULTIBASE_ERR_BUFFER_TOO_SMALL;
    }

    const uint8_t *in = data;
    char *dst = out;

    if (data_len & 1u)
    {
        uint16_t v = HEX8_LOOKUP[*in++];
        if (BIG_ENDIAN_SYSTEM)
        {
            *dst++ = (char)(v >> 8);
            *dst++ = (char)(v & 0xFF);
        }
        else
        {
            *dst++ = (char)(v & 0xFF);
            *dst++ = (char)(v >> 8);
        }
        --data_len;
    }

    size_t n_words = data_len >> 1; 
    size_t blocks = n_words >> 3;   

    while (blocks--)
    {
        uint32_t packed[8];
        for (int i = 0; i < 8; ++i)
        {
            uint16_t idx = (uint16_t)(in[0] << 8 | in[1]);
            packed[i] = HEX16_LOOKUP[idx];
            in += 2;
        }

        memcpy(dst, packed, sizeof packed);
        dst += sizeof packed;
    }

    while (in < data + (data_len & ~15u))
    {
        uint16_t idx = (uint16_t)(in[0] << 8 | in[1]);
        uint32_t v = HEX16_LOOKUP[idx];
        memcpy(dst, &v, sizeof v);
        dst += 4;
        in += 2;
    }

    *dst = '\0';
    return (int)(dst - out);
}

/**
 * @brief Decode a Base16 (hexadecimal) encoded string using lowercase letters.
 *
 * @param in       The input Base16 encoded string.
 * @param data_len The length of the input string (must be multiple of 2).
 * @param out      The buffer to store the decoded bytes.
 * @param out_len  The size of the output buffer (in bytes).
 * @return Number of decoded bytes, or an error code.
 *
 * @note
 * This table-based decoder only accepts lowercase 'a'–'f' for 10–15
 * and rejects uppercase 'A'–'F'. Adjust if you want uppercase acceptance.
 */
int multibase_base16_decode(const char *restrict in, size_t in_len, uint8_t *restrict out, size_t out_len)
{
    if (!in || !out)
    {
        return MULTIBASE_ERR_NULL_POINTER;
    }
    if (in_len & 1u)
    {
        return MULTIBASE_ERR_INVALID_INPUT_LEN;
    }

    size_t n_out = in_len >> 1;
    if (out_len < n_out)
    {
        return MULTIBASE_ERR_BUFFER_TOO_SMALL;
    }

    const unsigned char *src = (const unsigned char *)in;
    uint8_t *dst = out;
    size_t blocks = n_out >> 3; 

    while (blocks--)
    {
        uint16_t vals[8];
        for (int i = 0; i < 8; ++i)
        {
            uint16_t idx = (uint16_t)(src[0] << 8 | src[1]);
            uint16_t val = hexpair_decode_table[idx];
            if (val == HEX_DECODE_SENTINEL)
            {
                return MULTIBASE_ERR_INVALID_CHARACTER;
            }
            vals[i] = val;
            src += 2;
        }
        memcpy(dst, vals, sizeof vals);
        dst += sizeof vals;
    }

    while (dst < out + n_out)
    {
        uint16_t idx = (uint16_t)(src[0] << 8 | src[1]);
        uint16_t val = hexpair_decode_table[idx];
        if (val == HEX_DECODE_SENTINEL)
        {
            return MULTIBASE_ERR_INVALID_CHARACTER;
        }
        *dst++ = (uint8_t)val;
        src += 2;
    }
    return (int)n_out;
}

